events.script:
const string dp = $dp;
const string Ldp = $Ldp;


void cbValue(dyn_string dp, dyn_anytype value){
  bool in1 = value[1],
       in2 = value[2],
       in3 = value[3],
       in4 = value[4],
       in5 = value[5],
       in6 = value[6],
       in7 = value[7],
       in8 = value[8],
       out1 = value[9],
       out2 = value[10],
       out3 = value[11],
       out4 = value[12],
       out5 = value[13],
       out6 = value[14],
       out7 = value[15],
       out8 = value[16],
       reset = value[17];


dyn_shape in_shape = makeDynShape(getShape(&quot;in1_di&quot;),
                                  getShape(&quot;in2_di&quot;),
                                  getShape(&quot;in3_di&quot;),
                                  getShape(&quot;in4_di&quot;),
                                  getShape(&quot;in5_di&quot;),
                                  getShape(&quot;in6_di&quot;),
                                  getShape(&quot;in7_di&quot;),
                                  getShape(&quot;in8_di&quot;));

dyn_shape out_shape = makeDynShape(getShape(&quot;out1_di&quot;),
                                   getShape(&quot;out2_di&quot;),
                                   getShape(&quot;out3_di&quot;),
                                   getShape(&quot;out4_di&quot;),
                                   getShape(&quot;out5_di&quot;),
                                   getShape(&quot;out6_di&quot;),
                                   getShape(&quot;out7_di&quot;),
                                   getShape(&quot;out8_di&quot;));

  for (int i = 1; i &lt; 9; i++) {
    shape temp_in = in_shape[i];
    if (value[i]){
      temp_in.backCol(&quot;Red&quot;);
    }
    else {
      temp_in.backCol(&quot;Green&quot;);
    }
  }

  for (int i = 9; i &lt; 17; i++) {
    shape temp_out = out_shape[i-8];
    if (value[i]){
      temp_out.backCol(&quot;Red&quot;);
    }
    else {
      temp_out.backCol(&quot;Green&quot;);
    }
  }

}

main()
{

dpConnect(&quot;cbStatus&quot;, Ldp + &quot;.sts_bit&quot;);

  dpConnect(&quot;cbValue&quot;, dp + &quot;.status.in1&quot;,
                       dp + &quot;.status.in2&quot;,
                       dp + &quot;.status.in3&quot;,
                       dp + &quot;.status.in4&quot;,
                       dp + &quot;.status.in5&quot;,
                       dp + &quot;.status.in6&quot;,
                       dp + &quot;.status.in7&quot;,
                       dp + &quot;.status.in8&quot;,
                       dp + &quot;.status.out1&quot;,
                       dp + &quot;.status.out2&quot;,
                       dp + &quot;.status.out3&quot;,
                       dp + &quot;.status.out4&quot;,
                       dp + &quot;.status.out5&quot;,
                       dp + &quot;.status.out6&quot;,
                       dp + &quot;.status.out7&quot;,
                       dp + &quot;.status.out8&quot;,
                       dp + &quot;.value.reset&quot;);
  comment1.text(dpGetDescription(dp + &quot;.status.out1&quot;));
  comment2.text(dpGetDescription(dp + &quot;.status.out2&quot;));
  comment3.text(dpGetDescription(dp + &quot;.status.out3&quot;));
  comment4.text(dpGetDescription(dp + &quot;.status.out4&quot;));
  comment5.text(dpGetDescription(dp + &quot;.status.out5&quot;));
  comment6.text(dpGetDescription(dp + &quot;.status.out6&quot;));
  comment7.text(dpGetDescription(dp + &quot;.status.out7&quot;));
  comment8.text(dpGetDescription(dp + &quot;.status.out8&quot;));

}

